const Users = ({users}) => {
  return (
    <>
    <h2>Users</h2>
    <ul>
      {users.map(user => {
        return (
          <li key={user.id} style={{ paddingBottom: '10px' }}>
            <strong>{user.name}</strong>
            <p>{user.username} - {user.email}</p>
            <a href={`//${user.website}`}>{user.website}</a>
          </li>
        );
      })}
    </ul>
    </>
  );
}

export default Users;
